The Last Circus (2010)
Balada triste de trompeta (original title) 

During Spanish civil war in 1937, two circus clowns, Javier and Sergio, find that they are both enamored with the same female trapeze artist. They end up being forced to join the militia and the butchery starts while they are still in their costumes.         


